import React, { useState, useEffect } from 'react';
import './estilos/Registro.css'; 


const Registro = () => {
  const [tipoUsuario, setTipoUsuario] = useState(null);
  useEffect(() => {
    const tipo = localStorage.getItem('tipoUsuario');
    setTipoUsuario(tipo);
  }, []);
  const CamposComunes = () => (
    <div className="form-columns">
      {/* Campos comunes */}
      <div className="column" id="columna-izquierda">
        <label htmlFor="nombre">Nombre:</label>
        <input type="text" id="nombre" name="nombre" placeholder="Escribe tu nombre" required />
        
        <label htmlFor="apellido">Apellido:</label>
        <input type="text" id="apellido" name="apellido" placeholder="Escribe tu apellido" required />
        
        <label htmlFor="fecha-nacimiento">Fecha de Nacimiento:</label>
        <input type="date" id="fecha-nacimiento" name="fecha-nacimiento" required />
        
        <label htmlFor="telefono">Teléfono:</label>
        <input type="tel" id="telefono" name="telefono" placeholder="Ej: 2284555555" pattern="[0-9]+" title="Solo números" required />
      </div>
      
      <div className="column" id="columna-derecha">
        <label htmlFor="email">Email:</label>
        <input type="email" id="email" name="email" placeholder="Escribe tu email" required />
        
        <label htmlFor="direccion">Dirección:</label>
        <input type="text" id="direccion" name="direccion" placeholder="Ej: Av. Colon 1520" required />
        
        <label htmlFor="password">Contraseña:</label>
        <div className="password-container">
          <input type="password" id="password" name="password" placeholder="Escribe una contraseña" required />
          <i className="fas fa-eye-slash toggle-password" data-target="password"></i>
        </div>
        
        <label htmlFor="confirmar-password">Confirmar Contraseña:</label>
        <div className="password-container">
          <input type="password" id="confirmar-password" name="confirmar-password" placeholder="Confirmar contraseña" required />
          <i className="fas fa-eye-slash toggle-password" data-target="confirmar-password"></i>
        </div>
      </div>
    </div>
  );
  return (
    <div>
      <form id="registro-form">
        <h2 id="form-titulo">Registro de {tipoUsuario === 'Cliente' ? 'Usuario' : 'Profesional'}</h2>
        <CamposComunes />
        {tipoUsuario === 'profesional' && (
          <div className="form-tercera-columna" id="columna-profesional">
            {/* Campos adicionales para profesionales */}
            <div id="rubro-container">
              <div className="rubro-item">
                <select name="rubros[]" className="rubro-select" required>
                  <option value="">Selecciona un rubro</option>
                </select>
                <button type="button" className="btn-remove-rubro" title="Eliminar rubro">×</button>
              </div>
            </div>
            <button type="button" id="btn-agregar-rubro">+ Agregar otro rubro</button>
            <label htmlFor="empresa">Empresa (opcional):</label>
            <input type="text" id="empresa" name="empresa" placeholder="Nombre de tu empresa"/>
          </div>
        )}
        <button type="submit">Registrarse</button>
      </form>
    </div>
  );
};
export default Registro;
